import { useState,useRef } from "react";

const Messages=()=>{
    return(
        <div className="messages">
            <div 
                className="bot-message" 
                id="message1" 
                ref={botmessage}>
            </div>
            <div 
                className="human-message" 
                id="message2" 
                ref={humanmessage}>
            </div>
        </div>
    )

}

export default Messages
